import React from "react";
import Road from "../Road"

function RoadLevel6() {
    return (
        <div style = {{display:'flex',flexDirection:'column-reverse',marginLeft:'-20em',  marginTop:'-1.3em'}}>
            <div style = {{position:'relative'}}>
              <Road width={'10em'}
                height= {'3em'}
                StylingInfo = {'vertical-road'}/>
            </div>
            <div style = {{position:'relative'}}>
            <Road width={'10em'}
                height= {'10em'}
                StylingInfo = {'vertical-road'}
                dashType = {'vertical-dash'}/>
                   <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'vertical-road1'}
                  dashType = {'vertical-dashC'}/>
            </div>
            <div style = {{display:'flex',flexDirection:'row'}}>
              <div style = {{position:'relative', top:"-10em"}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
              </div>
              <div style = {{position:'relative', top: '-10em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
              <div style = {{position:'relative', top: '-10em'}}>
                <Road width={'-'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
              </div>
              <div style = {{position:'relative', top: '-10em'}}>
                <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', top: '-10em'}}>
                  <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', top: '-10em'}}>
                  <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', top: '-10em'}}>
                  <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>
                <div style = {{position:'relative', top: '-10em'}}>
                  <Road width={'10em'}
                  height= {'10em'}
                  StylingInfo = {'horizontal-road1'}
                  dashType = {'horizontal-dash'}/>
                </div>

              </div>
               
                
            </div>
    )

}

export default RoadLevel6
